import React from 'react'
import { Row } from 'react-bootstrap'
import products from '../products'

const HomeScreen = () => {
    return (
        <>
          <h1>Latest Products</h1>
            <Row>
                {products.map( ()=>{
                    <Col
                        sm={24}
                        md={12}
                        lg={6}
                        xlg={3}
                        >
                        <h3>{product.name}</h3>
                    </Col>
                })}
            </Row>
        </>
    )
}

export default HomeScreen
